export async function getStaticProps() {
  // Run API calls in parallel
  const [articles, categories, homepage, global, landingpage, writers, videos, vidCatogires] = await Promise.all([
    fetchAPI("/articles?status=published"),
    fetchAPI("/categories"),
    fetchAPI("/homepage"),
    fetchAPI("/global"),
    fetchAPI("/landing-page"),
    fetchAPI("/writers"),
    fetchAPI("/videos"),
    fetchAPI("/vid-catagories"),

  ]);

  return {
    props: { articles, categories, homepage, global, landingpage, writers, videos, vidCatogires },
    revalidate: 1,
  };
}

